            cout << setw(5) << arr[i][j];
            Output << setw(5) << arr[i][j];
        }
        cout << "\n";
        Output << "\n";
    }
}

void symmetry(int** arr, int n) {
    for (int i = 0, m = n - 1; i < n; i++, m--) {
        swap(arr[i][i], arr[m][i]);
    }
}

