template<typename T> void read(vt<T> & a) {For(i, a.size()) cin >> a[i];}
template<typename T> void read2(vt<vt<T> > & a) {For(i, a.size()) read(a[i]);}
template<typename T> void print(vt<T> & a) {For(i, a.size()) cout << a[i] << " "; cout << endl;}
template<typename T> void print2(vt<vt<T> > & a) {For(i, a.size()) print(a[i]);}

const int MAX = 1e9;
const int MOD = 1000000007;
const ll  INF = 1e18;
const ld  PI  = 3.14159265358979323846;

void solve() {
    int n, m; cin >> n >> m;
    vt<vt<pii> > g(n); 
	For(i, m) {
		int u, v, d; cin >> u >> v >> d; u--, v--;	
		g[u].push_back({v, d});
		g[v].push_back({u, d});
	}
    vt<int> dist(n), dist2(n);
    auto bfs = [&] (int u, vt<int> & dist) {
        vt<bool> used(n);
        queue<int> q;
        q.push(u);
        used[u] = true;
        while (!q.empty()) {
            int v = q.front();
            q.pop();
            for (auto [to, _] : g[v]) {
                if (used[to]) continue;
                used[to] = true;
                q.push(to);
                dist[to] = dist[v] + 1;
            }
        }
    };
    bfs(0, dist);
    bfs(n - 1, dist2);
    vt<int> mn(n, MAX), mx(n, -MAX),
            mn2(n, MAX), mx2(n, -MAX),
            p_mn(n, -1), p_mx(n, -1),
            p_mn2(n, -1), p_mx2(n, -1);
    vt<bool> need(n), need2(n);
    need[n - 1] = true;
    need2[0] = true;
    vt<bool> visited(n), visited2(n);
    auto go = [&] (auto go, int u, vt<bool> & need, vt<bool> & visited, vt<int> & dist) -> void {
        if (visited[u]) return;
        visited[u] = true;
        for (auto [to, d] : g[u]) {
            if (dist[to] == dist[u] + 1) {
                go(go, to, need, visited, dist);
                if (need[to]) {
                    need[u] = true;
                }
            }
        }
    };
    go(go, 0, need, visited, dist);
    go(go, n - 1, need2, visited2, dist2);
    auto dfs = [&] (auto dfs, int u, vt<bool> & need, vt<bool> & visited, vt<int> & mn, vt<int> & mx, vt<int> & p_mn, vt<int> & p_mx, vt<int> & dist) -> void {
        if (visited[u]) return;
        visited[u] = true;
        for (auto [to, d] : g[u]) {
            if (dist[to] == dist[u] + 1 && need[to]) {
                dfs(dfs, to, need, visited, mn, mx, p_mn, p_mx, dist);
                int v_mn = min(mn[to], d);
                int v_mx = max(mx[to], d);
                if (mn[u] > v_mn) {
                    mn[u] = v_mn;
                    p_mn[u] = to;
                }
                if (mx[u] < v_mx) {
                    mx[u] = v_mx;
                    p_mx[u] = to;
                }
            }
        }
    };
    visited = vt<bool> (n);
    visited2 = vt<bool> (n);
    dfs(dfs, 0, need, visited, mn, mx, p_mn, p_mx, dist);
    dfs(dfs, n - 1, need2, visited2, mn2, mx2, p_mn2, p_mx2, dist2);
    int ans = -1;
    for (int i = 0; i < n; i++) {
        if (mx[i] == -MAX) mx[i] = mn2[i];
        if (mn[i] == MAX) mn[i] = mx2[i];
        if (mx2[i] == -MAX) mx2[i] = mn[i];
        if (mn2[i] == MAX) mn2[i] = mx[i];
        ans = max({ans, mx[i] - mn2[i], mx2[i] - mn[i]});
    }
    int type = -1, idx = -1;
    for (int i = 0; i < n; i++) {
        if (mx[i] - mn2[i] == ans) {
            type = 1;
            idx = i;
            break;
        }
        if (mx2[i] - mn[i] == ans) {
            type = 2;
            idx = i;
            break;
        }
    }
    vt<int> res;
    if (type == 1) {
        int u = idx;
        while (true) {
            u = p_mn2[u];
            if (u == -1) break;
            res.push_back(u);
        }
        reverse(all(res));
        u = idx;
        while (u != -1) {
            res.push_back(u);
            u = p_mx[u];
        }
    } 
    else {
        int u = idx;
        while (true) {
            u = p_mx2[u];
            if (u == -1) break;
            res.push_back(u);
        }
        reverse(all(res));
        u = idx;
        while (u != -1) {
            res.push_back(u);
            u = p_mn[u];
        }
    }
    cout << res.size() - 1 << endl;
    for (int u : res) {
        cout << u + 1 << " ";
    }
    cout << endl;
}

