import "fmt"

func Solve(slice []int) []int { 
	lastIndex := make(map[int]int)

	
	for i, key := range slice {
		lastIndex[key] = i
	}

	result := []int{}

	
	for i := len(slice) - 1; i >= 0; i-- {
		value := slice[i]
		
		if lastIndex[value] == i {

			result = append([]int{value}, result...)
		}
	}

	return result
}

