class Solution
{
public:
   string s;
int n;
unordered_map<string, bool> exist;
int dp[2222];
int rec(int at) {
    if(at >= s.size()) {
        return 1;
    }
    if(dp[at] != -1) {
        return dp[at];
    }
    int res = 0;
    string tmp = "";
    for(int i = at; i < s.size(); i++) {
        tmp += s[i];
        if(exist[tmp]) {
            res = max(res, rec(at + tmp.size()));
        }
    }
    return dp[at] = res;
}
int wordBreak(int n, string s, vector<string> &dictionary) {
        this->n = n;
        this->s = s;
        for(string s : dictionary) {
            exist[s] = true;
        }
        memset(dp, -1, sizeof dp);
        return rec(0);
}
};

class Solution{
    public:
    typedef long long ll;
    
    long long countWays(int n, ll k){
    
        vector<ll> dp(n + 1);
        dp[1] = k;
        dp[2] = (k * k);
        const ll MOD = 1e9 + 7;
        for(int i = 3; i <= n; i++) {
            dp[i] = (((dp[i - 1] + dp[i - 2]) % MOD) * ((k - 1) % MOD)) % MOD;
        }
        return dp[n] % MOD;
    }
};
